// SPDX-License-Identifier: MIT
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

contract NiftyFiftyNFT is ERC721URIStorage, Ownable {
  using Counters for Counters.Counter;

  Counters.Counter tokenIdCounter;

  struct RoyaltyDetail {
    address royaltyToken;
    uint amount;
    address artist;
    uint counter;
  }

  mapping(address => uint[]) tokenIdMap;

  mapping(uint => RoyaltyDetail) royaltyDetails;

  uint maxRoyaltyCount;

  constructor() ERC721('NiftyFiftyNFT', 'NIFNFT') {
    maxRoyaltyCount = 10; // this can be changed later on
  }

  function getRoyaltyDetails(uint tokenId) public view returns (address, uint, address, uint) {
    return (royaltyDetails[tokenId].royaltyToken, royaltyDetails[tokenId].amount, royaltyDetails[tokenId].artist, royaltyDetails[tokenId].counter);
  }

  function _getRoyaltyDetails(uint tokenId) internal view returns(RoyaltyDetail memory) {
    return royaltyDetails[tokenId];
  }

  function getTokenIds(address artist) public view returns (uint [] memory) {
    return tokenIdMap[artist]; 
  }

  function mint(address _royaltyToken, uint _amount, string memory _tokenURI) public {
    tokenIdCounter.increment();
    uint tokenId = tokenIdCounter.current();
    royaltyDetails[tokenId].royaltyToken = _royaltyToken;
    royaltyDetails[tokenId].amount = _amount;
    royaltyDetails[tokenId].artist = msg.sender;
    royaltyDetails[tokenId].counter = 0;
    _mint(msg.sender, tokenId);
    tokenIdMap[msg.sender].push(tokenId);
    _setTokenURI(tokenId, _tokenURI);
  }

  function _payRoyalty (address from, uint tokenId) public {
    RoyaltyDetail memory _rdetails = _getRoyaltyDetails(tokenId);
    IERC20 token = IERC20(_rdetails.royaltyToken);

    if (_rdetails.counter >= maxRoyaltyCount) {
      if (from != _rdetails.artist) {
        token.transferFrom(from, _rdetails.artist, _rdetails.amount);
      }

    } else {
      uint split = _rdetails.amount / 2;
      token.transferFrom(from, owner(), split);

      token.transferFrom(from, _rdetails.artist, split);

      royaltyDetails[tokenId].counter = royaltyDetails[tokenId].counter + 1;
    }
  }

  function transferFrom(address from, address to, uint tokenId) public override {
    require(_isApprovedOrOwner(_msgSender(), tokenId), "ERC721: transfer caller is not owner nor approved");
    _payRoyalty(from, tokenId);
    _transfer(from, to, tokenId);
  }  

  function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId
    ) public virtual override {
        _payRoyalty(from, tokenId);
        safeTransferFrom(from, to, tokenId, "");
    }


  function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId,
        bytes memory _data
    ) public virtual override {
        require(_isApprovedOrOwner(_msgSender(), tokenId), "ERC721: transfer caller is not owner nor approved");
        _payRoyalty(from, tokenId);
        _safeTransfer(from, to, tokenId, _data);
    }


}
